import React, { Component } from 'react';
import './login.css'

class Login extends Component {
    render() {
        return (
            <form className='form'>
                <div className='inpDiv'>
                    <label htmlFor='userName' >Username/Email :</label><br></br>
                    <input id='userName' className='userInp' placeholder='Enter your name here:' />
                </div>
                <div className='inpDiv'>
                    <label htmlFor='userPassword'>Password :</label><br></br>
                    <input id='userPassword' className='userInp' type={text} name='name' required placeholder='Enter your password here:' />
                </div>
            </form>
        )
    };
};

export default Login;
